<!DOCTYPE html>
<html>
<head>
    <meta http-equiv="content-type" content="text/html; charset=utf-8">
    <link rel="stylesheet" type="text/css" href="lib/irb/cocoa/inspector.css">
</head>
<body>
	<table id="console-messages">
		<tr class="basic-node">
			<td class="prefix">irb(main)001:0></td>
			<td class="value">"foobar"</td>
		</tr>
		<tr class="expandable-node">
			<td class="prefix"><img src="lib/irb/cocoa/images/disclosureTriangleSmallRight.png" /></td>
			<td class="value">"foobar"</td>
		</tr>
		<tr class="basic-node">
			<td class="prefix">irb(main)002:0></td>
			<td class="value">[1,2]</td>
		</tr>
		<tr class="expandable-node">
			<td class="prefix"><img src="lib/irb/cocoa/images/disclosureTriangleSmallDown.png" /></td>
			<td class="value">[1,2]</td>
		</tr>
		<tr class="expanded-node">
			<td class="prefix"></td>
			<td class="value">
				<table>
					<tr class="basic-node">
						<td class="prefix"></td>
						<td class="value">Class: String</td>
					</tr>
					<tr class="expandable-node">
						<td class="prefix"><img src="lib/irb/cocoa/images/disclosureTriangleSmallRight.png" /></td>
						<td class="value">Public methods</td>
					</tr>
				</table>
			</td>
		</tr>
	</table>
</body>
</html>
